export default function Header(){
    return(
        <header className="header">
            <img 
                className="header--image"
                src="/images/Troll-face.png" />
            <h2 className='header--title'> Header component</h2>
            <h4 className='header--text'> React Course - Project 3</h4>
        </header>
    )
}
